import React from 'react';
import '../styles/Carros.css'; // Importando o CSS

// Dados dos carros com imagens
const categorias = [
    {
        nome: "VW",
        carros: [
            { nome: "Virtus", img: require('../assets/images/virtus.png').default },
            { nome: "Voyage", img: require('../assets/images/voyage.png').default },
            { nome: "Polo Track", img: require('../assets/images/polo.png').default },
            { nome: "Gol", img: require('../assets/images/voyage.png').default },
        ]
    },
    {
        nome: "Hyundai",
        carros: [
            { nome: "Ioniq", img: require('../assets/images/Ioniq.png').default },
        ]
    },
    {
        nome: "Renaut",
        carros: [
            { nome: "Sandero", img: require('../assets/images/sandero.png').default },
            { nome: "Logan", img: require('../assets/images/logan.png').default },
            { nome: "Duster", img: require('../assets/images/hyundai-duster.jpg').default },
        ]
    },
    {
        nome: "Nissan",
        carros: [
            { nome: "Versa", img: require('../assets/images/nissan-versa.jpg').default },
        ]
    },
    {
        nome: "Toyota",
        carros: [
            { nome: "Corolla", img: require('../assets/images/toyota-corolla.jpg').default },
            { nome: "Corolla Cross", img: require('../assets/images/toyota-corolla-cross.jpg').default },
            { nome: "Prius", img: require('../assets/images/toyota-prius.jpg').default },
            { nome: "Etios", img: require('../assets/images/toyota-etios.jpg').default },
        ]
    },
    {
        nome: "GM",
        carros: [
            { nome: "Spin", img: require('../assets/images/gm-spin.jpg').default },
            { nome: "Prisma", img: require('../assets/images/gm-prisma.jpg').default },
            { nome: "Onix Plus", img: require('../assets/images/gm-onix-plus.jpg').default },
        ]
    },
];

function Carros() {
    return (
        <section className="carros">
            <h2>Nossos Carros</h2>
            <div className="carros-list">
                {categorias.map((categoria) => (
                    <div className="categoria" key={categoria.nome}>
                        <h3>{categoria.nome}</h3>
                        <div className="carros-grid">
                            {categoria.carros.map((carro) => (
                                <div className="carro" key={carro.nome}>
                                    <img src={carro.img} alt={carro.nome} className="carro-imagem" />
                                    <h4>{carro.nome}</h4>
                                </div>
                            ))}
                        </div>
                    </div>
                ))}
            </div>
        </section>
    );
}

export default Carros;
